from collections import deque


class Solution:
    def solve(self, nums, k):
        if not nums: return 0
        n = len(nums)
        dp = [0] * n

        for i in range(n):
            dp[i] = 1
            m = 1
            for j in range(i):
                if -k < nums[i] - nums[j] < k:
                    if dp[j] + 1 > m:
                        m = dp[j] + 1
            dp[i] = m

        return max(dp)

