    def solve2(self, nums, k):
        if not nums: return 0
        n = len(nums)
        dp = [0] * n

        for i in range(n):
            dp[i] = 1
            for j in range(i):
                if abs(nums[i] - nums[j]) < k:
                    dp[i] = max(dp[i], dp[j] + 1)

        return max(dp)


